  18,\n\t\"tags\": [],\n\t\"title\": \"CONDUCTIVITY, WIND DIRECTION, SHORTWAVE IRRADIANCE,
  AIR TEMPERATURE and other underway - surface data collected in the North Atlantic
  Ocean on the ENDEAVOR and OCEANUS cruises EN292, EN296 and others as part of the
  GB project from 1997-01-07 to 1997-10-28 (NODC Accession 0105668)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-27T00:57:12.707797\",\n\t\"name\": \"conductivity-wind-direction-shortwave-irradiance-air-temperature-and-other-underway-surface-da47e70\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0105668 includes underway
  - surface, meteorological, chemical, physical and optical data collected aboard
  the ENDEAVOR and OCEANUS during cruises EN292, EN296, EN298, EN301, EN302, EN303,
  EN307, EN308, OC296, OC298, OC300, OC301, OC302 and OC303 in the North Atlantic
  Ocean from 1997-01-07 to 1997-10-28. These data include CONDUCTIVITY, WIND DIRECTION,
  SHORTWAVE IRRADIANCE, AIR TEMPERATURE, WIND SPEED, LONGWAVE IRRADIANCE, SALINITY
  - SURFACE WATER, RELATIVE HUMIDITY, PRECIPITATION, BAROMETRIC PRESSURE and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include thermosalinographs.
  These data were collected by Richard Payne of Woods Hole Oceanographic Institution
  as part of GB. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
  submitted these data to NODC on 2013-04-13.nnThe following is the text of the abstract
  provided by BCO-DMO:nnContinuous along track meteorology and sea surface data,n60
  minute averaged values, 1997nnProcessed by:nRichard PaynenWoods Hole Oceanographic
  InstitutionnWoods Hole, MA 20543nrpayne@whoi.edu (mailto:rpayne@whoi.edu)nnAdditionalndata
  processing notes (http://globec.whoi.edu/globec-dir/data_doc/additional_endeavor_processing_details.html)
  are available.nnThe sea surface temperature as measured by the hull sensor is not
  shown since the sea surface temperature as measured via the engine inlet (field
  name is temp_ss1) is more accurate.nProcessing NotesnnConcatenate daily 1 minute
  files into one file for whole cruisenEdit file for obvious bad data, i.e., missing
  data, garbage characters, etc.nRun program which reformats data. Output parameters:nYear
  day, lat, long, Speed made good, course made good, gyro 1 & 2, Edo speed, Edo indicator,
  port wind speed, starboard ws, port wind azimuth, starboard waz, air temp, relative
  humidity, barometric pressure, sea surface temp @5m & 1m depth, Edo depth, Chirp
  sonar depth.nPut plots of all parameters on screen and look for obvious single bad
  points. Edit in basic concatenated file. Except I have not edited depths.nIterate
  steps 2-4 until no more obvious bad points.nRun second program which computes true
  wind speed and direction from speed and course made good, gyros, larger of port
  or starboard ws and accompanying wind azimuth. Outputs are year day, lat lon, speed
  and course made good, gyro, relative ws and direction, true ws and direction, air
  temp, relative humidity, barometric pressure, short- and long-wave radiation,5m
  and 1m sea surface temps, Edo depth, Chirp sonar depth, Edo speed, Edo indicator.nCheck
  plots of true wind speed and direction to make sure they look ok.nRun vector averaging
  program which produces 60 minute series. The program uses 60 consecutive records
  and does not check for missing records. I have not carried depths since hourly averages
  do not seem useful nor Edo speeds since they seem pretty generally useless. Output
  parameters are: Year day, lat, long, true wind speed and direction, air temp, relative
  humidity, barometric pressure, short- and long-wave radiation, sea surface temp
  @ 5m & 1m.nnThe data quality is generally pretty poor on the Oceanus cruises. OC297
  and OC298 have no SOG, COG, or gyro so I could not correct the winds. I almost set
  the TWS, TWD to 0 but decided to leave them in as RWS, RWD. One could get a semiqualitative
  feel for the winds. OC301 had gyro but no SOG, COG so I computed them from the GPS
  position differences. It came out better than I expected. Warn users to be skeptical
  about the Oceanus data.nFrom: Richard E. Payne / 11 Apr 1997 09:05:25 -0400nUpdated:
